I have a list of strings, and I want to sort them in case-sensative way. For example, I have a list of strings: ["a", "A", "b", "B", "c", "C"] and I want to sort them in this order: ["A", "a", "B", "b", "C", "c"].
I tried to use sort() method, but it sorts them in case-insensitive way.
How can I sort them in case-sensative way?
You can use localeCompare() to compare strings in a case-sensitive way:
const list = ["a", "A", "b", "B", "c", "C"];
list.sort((a, b) => a.localeCompare(b));
console.log(list);
["A", "a", "B", "b", "C", "c"]
